import React from 'react';
import './style.css';

export default class App extends React.Component {
    render() {
      return (
        <div className="App">
          <header className="App-header">
            <p>
              Edit <code></code> and save to reload.
            </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
      )
    }
}
